	public String[][] getStyle(int type) {
		
		switch(type) {
			
			case 0: return Big;
			case 1: return BulHead;
			case 2: return ThreeD;
			case 3: return Dash;
			case 4: return Alligator2;
			case 5: return Banner;
			case 6: return Block;
			case 7: return Coinstak;
			case 8: return Larry3d;
			case 9: return Universe;
			default: return Big;
		}
		
	}
	
